import React from "react";

const CourseRowComponent = ({course, deleteCourse,editCourse}) => (
  <tr>
    <td>
    {course.title}
    <input className="form-control"></input>
    </td>
    <td>{course.owner}</td>
    <td>{course.lastUpdated}</td>
    <td>
      <button
        onClick={() => deleteCourse(course)} //careful!!!
        className="btn btn-success">
        Delete
      </button>
      <button 
      onClick={() => editCourse}
      className="btn btn-info">Edit</button>
    </td>
  </tr>
);

export default CourseRowComponent;
